description:
The database allows you to:
Search your favorite fragment among PDB ligands or sketch it;
Define similarity rules to retrieve potential bioisosteres;
Score bioisosteres according to interaction pattern similarity;
Align bioisosteres to your reference scaffold;
Visualize the proposed alignment.

Catalogued 8,309 genetic variants in 1,288 genes of 17,738 patients with formatted clinical phenotypic features from 1,855 studies;
Integrated more than 62 popular variant-level and gene-level genomic data sources to interpret the function and pathogenicity of genetic variants;
Provided a convenient interface for users to analysis their own genetic data, perform comprehensive annotation, and identified genotype-phenotype correlations.
